function HeaderComponent({content}) {
    return (
        <header className="pageHeader container d-flex flex-column justify-content-center">
            {content.map((index) => (
                <h1 key={index} className=''>{index.title}</h1>
            ))}
            {content.map((index) => (
                <p key={index} className=''>{index.subtitle}</p>
            ))}
            {content.map((index) => (
                <p key={index} className='' href={index.href}>{index.icon}{index.title}</p>
            ))}
        </header>
    );
}

export default HeaderComponent;
